[{"location":"appendix/#Bijlage","page":"Appendix","title":"Bijlage","text":"","category":"section"},{"location":"appendix/","page":"Appendix","title":"Appendix","text":"info: Info\nZorg ervoor dat je toestemming hebt van een ouder of verantwoordelijke volwassene voordat je iets downloadt op je computer. Als je hulp nodig hebt tijdens het downloaden en installeren, vraag dan aan een ouder of verantwoordelijke volwassene om je te helpen.","category":"page"},{"location":"appendix/#Introduction","page":"Appendix","title":"Introduction","text":"","category":"section"},{"location":"appendix/","page":"Appendix","title":"Appendix","text":"Ik heb zelf een Lenovo Legion Y520 Windows 10 laptop met Ubuntu 22.04 ge√Ønstalleerd op een Samsung portable SSD T5 schijf. Ik start mijn machine op vanaf deze schijf.","category":"page"},{"location":"blog/#Blog","page":"Blog","title":"Blog","text":"","category":"section"},{"location":"blog/#","page":"Blog","title":"2024","text":"","category":"section"},{"location":"blog/#12-2024-Set-up-of-the-course","page":"Blog","title":"20-12-2024 - Set up of the course","text":"","category":"section"},{"location":"blog/","page":"Blog","title":"Blog","text":"Today set up of the basic structure for the LLM course.","category":"page"},{"location":"references/#References","page":"References","title":"References","text":"","category":"section"},{"location":"references/#YouTube","page":"References","title":"YouTube","text":"","category":"section"},{"location":"references/#Diversen","page":"References","title":"Diversen","text":"","category":"section"},{"location":"chapter1/#Install-Docker","page":"1 Install Docker","title":"Install Docker","text":"","category":"section"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"UNDER DEVELOPMENT","category":"page"},{"location":"chapter2/#Install-the-MiniConda-container","page":"2 Install the MiniConda container","title":"Install the MiniConda container","text":"","category":"section"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"UNDER DEVELOPMENT","category":"page"},{"location":"chapter4/#How-to-get-ChatGPT's-API-key","page":"4 How to get ChatGPT's API key","title":"How to get ChatGPT's API key","text":"","category":"section"},{"location":"chapter4/","page":"4 How to get ChatGPT's API key","title":"4 How to get ChatGPT's API key","text":"UNDER DEVELOPMENT","category":"page"},{"location":"overview/#Overview-Linux-Terminal-commando's","page":"Overview Linux Terminal commando's","title":"Overview Linux Terminal commando's","text":"","category":"section"},{"location":"overview/#Overview-Node-RED","page":"Overview Linux Terminal commando's","title":"Overview Node-RED","text":"","category":"section"},{"location":"overview/#Overzicht-MicroPython","page":"Overview Linux Terminal commando's","title":"Overzicht MicroPython","text":"","category":"section"},{"location":"overview/#Summary","page":"Overview Linux Terminal commando's","title":"Summary","text":"","category":"section"},{"location":"overview/","page":"Overview Linux Terminal commando's","title":"Overview Linux Terminal commando's","text":"Top","category":"page"},{"location":"chapter3/#Docker-commands","page":"3 Docker commands","title":"Docker commands","text":"","category":"section"},{"location":"chapter3/","page":"3 Docker commands","title":"3 Docker commands","text":"UNDER DEVELOPMENT","category":"page"},{"location":"chapter5/#Create-the-.env-file-for-API-keys","page":"5 Create the .env file for API keys","title":"Create the .env file for API keys","text":"","category":"section"},{"location":"chapter5/","page":"5 Create the .env file for API keys","title":"5 Create the .env file for API keys","text":"UNDER DEVELOPMENT","category":"page"},{"location":"#LLMs","page":"Introduction","title":"LLMs","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"UNDER DEVELOPMENT","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"This course is a supplement to Ed Donner's course on Udemy: 'LLM Engineering: Master AI & Large Language Models (LLMs)' for developers whose work with Ubuntu 22.04'.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"info: Info\nLook at Blog for the latest remarks!","category":"page"},{"location":"#Introduction","page":"Introduction","title":"Introduction","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"My name is Rob Bontekoe and I am attendig Ed Donner's Udemy course LLM Engineering: Master AI & Large Language Models (LLMs).","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"<img src=\"data:image/jpeg;base64,\" alt=\"Docker logo\" width=\"120\">","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Logo Ed Donner's course","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"I work with Ubuntu 22.04 Desktop version. I asked Ed whether I could attend the course using MiniConda. He said: \"Hey Rob, I haven't tested miniconda myself, but another student mentioned that he used miniconda and everything went great. I'd actually be super grateful if you could give it a whirl and let me know - then I can update the instructions with this as an approach. Thanks so much Ed.\"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"I also prefer to use Docker, because it gives you less trouble on your system. Looking at https://docs.anaconda.com/anaconda/install/ I saw in step 4 https://docs.anaconda.com/working-with-conda/applications/docker/ the next Docker instruction:","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"docker run -i -t -p 8888:8888 continuumio/miniconda3 /bin/bash \\\n-c \"/opt/conda/bin/conda install jupyter -y --quiet && mkdir \\\n/opt/notebooks && /opt/conda/bin/jupyter notebook \\\n--notebook-dir=/opt/notebooks --ip='*' --port=8888 \\\n--no-browser --allow-root\"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Because I prefer to use docker-compose I translated the command with Gemini into a compose.yml file which I can use with docker-compose to create de container automatically. ","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"The advantage was that I only had to restart the container and could use a one time generated api key to enter Jupyter notebooks.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"version: \"3.9\" # Use the latest version of the Docker Compose file format\n\nservices:\n  jupyter-notebook:\n    image: continuumio/miniconda3\n    ports:\n      - \"8888:8888\"\n    command: \n      - /bin/bash\n      - \"-c\"\n      - |\n        conda install jupyter -y --quiet && \\\n        mkdir -p /opt/notebooks && \\\n        jupyter notebook \\\n          --notebook-dir=/opt/notebooks \\\n          --ip='*' \\\n          --port=8888 \\\n          --no-browser \\\n          --allow-root\n    volumes:\n      - ./notebooks:/opt/notebooks \n    tty: true\n    stdin_open: true","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Rob Bontekoe","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"info: This course is licensed under the MIT License.\nAn MIT license is a type of software license, also known as an open-source license. It's one of the most permissive licenses available, meaning it grants users a wide range of freedoms to use, modify, and distribute the software.","category":"page"}]
